import React from 'react'
import {Link} from "react-router-dom"
import {Formik, Form, Field, ErrorMessage} from 'formik';
import { useEffect, useState} from 'react';
import { useParams , useNavigate } from 'react-router-dom';
import axios from "axios";
import * as Yup from 'yup';

 function GenerateMealPlan() {
    const email = sessionStorage.getItem("email");

    const [listOfRecipes, setlistOfRecipes] = useState([]);
    const [listOfConstraintedRecipes, setlistOfConstraintedRecipes] = useState([]);
    const navigate = useNavigate();



    useEffect(() => {
        axios.get("http://localhost:3001/recipes").then((response) => {
          setlistOfRecipes(response.data);
        });
      }, []);

    const initialValues = {
        name: "",
        type: "",
    };



    const  onSubmit = async (data) => {

        let score;
        let constraints;
        let selectedRecipeIds = [];
        var userId;

        axios.get(`http://localhost:3001/authentication/${email}`).then((response) => {
            userId = response.data;
            axios.get(`http://localhost:3001/profiles/${userId}`).then((response) => {
                 score = response.data.score;
                 constraints = response.data.constraints;
                 if (constraints) {
                    const constraintedRecipes =  listOfRecipes.filter((recipe) =>
                      constraints.includes(recipe.category)
                    );
                    setlistOfConstraintedRecipes(constraintedRecipes);
                  } else {
                    setlistOfConstraintedRecipes(listOfRecipes);
                  }
                  if (listOfConstraintedRecipes.length > 0) {

                    const requests = listOfConstraintedRecipes.map((recipe) => {
                        return axios.get(`http://localhost:3001/recipes/portion/${recipe.id}`);
                    });
                
                    Promise.all(requests).then((responses) => {
                      responses.forEach((response, index) => {
                        const recipe = listOfConstraintedRecipes[index];
                        recipe.totalCalories = response.data.portion;
                        recipe.quantity = recipe.quantity / response.data.portions;
                      });
                    });


                    console.log(listOfConstraintedRecipes);

                  }

                  var leftScore;
                  switch(data.type) {
                    case 'cut':
                      leftScore = score - 300;
                      break;
                    case 'mantain':
                      leftScore = score;
                      break;
                    case 'bulk':
                      leftScore = score + 300;
                      break;
                    default:
                      break;
                  }
                  while (selectedRecipeIds.length < 3) {
                    const randomArrayIndex = Math.floor(Math.random() * listOfConstraintedRecipes.length);
                    const randomRecipe = listOfConstraintedRecipes[randomArrayIndex];
                    
                    if (randomRecipe.totalCalories <= leftScore ) {
                      selectedRecipeIds.push(randomRecipe.id);
                      leftScore -= randomRecipe.totalCalories;
                      listOfConstraintedRecipes.splice(randomArrayIndex, 1);
                    }
                    else {
                      listOfConstraintedRecipes.splice(randomArrayIndex, 1);
                    }
                  }

                  console.log(selectedRecipeIds);
                  const temp = {
                    recipeIds: selectedRecipeIds,
                    name: data.name,
                    type : data.type,
                    userId: userId
                  };
                  axios.post("http://localhost:3001/mealplans/generate", temp).then((response) => {
                    //console.log(response.data);
                  });

                  
                  navigate("/mealplans");


 
              });

        });


    };



    const validationSchema = Yup.object().shape({
        name: Yup.string().required(),
        type: Yup.string().required(),

    });


  return (
    <div className='App'>
<div className='createProfilePage'>
        {/* <Link to="/">Back</Link> */}
        <div className='createProfilePageForm'>
            <Formik initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}>
                <Form>
                    <label>Meal Plan Name: </label>
                    <ErrorMessage name="name" component="span"/>
                    <Field autoComplete="off" id="inputGenerateMealPlan" name="name" placeholder="Example: 19 June Monday " />

                    <label>Goal : </label>
                    <ErrorMessage name="type" component="span"/>
                    <Field as="select" id="inputGenerateMealPlan" name="type">
                      <option value="">Select a Goal</option>
                        <option value="cut">Loose Weight</option>
                        <option value="mantain">Maintain</option>
                        <option value="bulk">Gain Weight</option>
                    </Field>
                    

                    <button type="submit">Generate MealPlan</button>
                </Form>
            </Formik>
        </div>
    </div>
    </div>
    
  )
}

export default GenerateMealPlan
